import './App.css';
/*Importe o component e a  pasta */
import Evento from './components/Evento';
import Form from './components/Form';

function App() {
  return (
    <div className="App">
      <h1>Testando Eventos</h1>
      <Evento numero={1}/>
      <Evento numero={2} />
      <Form />
    </div>
  );
}
export default App;
